import { Input } from 'antd';
import React from 'react';
import { useState } from 'react';
const App = (props) => {
    const [setInputValue] = useState('');
    return(
        <Input placeholder="等待输入" onChange={e => {
            setInputValue(e.target.value);
        }}/>
    )
}

export default App;
